export enum AllTypeActions {
	POST_LOGIN = 'POST_LOGIN',
	GET_CURRENT_ADMIN = 'GET_CURRENT_ADMIN',
	GLOBAL_SEARCH = 'GLOBAL_SEARCH',
	SYSTEM_MESSAGE_SHOW = 'SYSTEM_MESSAGE_SHOW',
	SYSTEM_MESSAGE_HIDE = 'SYSTEM_MESSAGE_HIDE',
	GET_ADMIN_ROLES = 'GET_ADMIN_ROLES',
	GET_ADMIN_ROLE = 'GET_ADMIN_ROLE',
	CREATE_ADMIN_ROLE = 'CREATE_ADMIN_ROLE',
	UPDATE_ADMIN_ROLE = 'UPDATE_ADMIN_ROLE',
	GET_ADMIN_ACCOUNTS = 'GET_ADMIN_ACCOUNTS',
	GET_ADMIN_ACCOUNT = 'GET_ADMIN_ACCOUNT',
	CREATE_ADMIN_ACCOUNT = 'CREATE_ADMIN_ACCOUNT',
	UPDATE_ADMIN_ACCOUNT = 'UPDATE_ADMIN_ACCOUNT',
	LOAD_USERS_LOADING = 'LOAD_USERS_LOADING',
	LOAD_USERS_SUCCESS = 'REDUX_SAGA_LOAD_USERS_SUCCESS',
	LOAD_USERS_ERROR = 'REDUX_SAGA_LOAD_USERS_ERROR',
}

export const loadUsers = () => (dispatch) => {
	dispatch({ type: AllTypeActions.LOAD_USERS_LOADING });
	console.log(loadUsers);
};
